import React from "react";
import { NavLink } from "react-router-dom";

function Layout(props)
{
	return (
		<nav className="navbar" >
			<span className="logo">
			<NavLink className="navlink" to={ props.links.index }>Super-Mega Questions</NavLink>
			</span>
			<ul>
				<li>
				<NavLink
				className="navlink"
				activeClassName="navlinkActive"
				to={ props.links.create }>
					Create Question
				</NavLink>
				</li>
				<li>
				<NavLink to={ props.links.create }>Create Question</NavLink>
				</li>
			</ul>
		</nav>
	);
}

export default Layout;
